import React, { useState } from "react";
import { Container, Button, Col, Row } from "react-bootstrap";
import svgImg from "../../svg/mobile-app.svg";

import "./Banner.css"; // Importa los estilos CSS

const Banner = () => {
  const options = ["Opci贸n 1", "Opci贸n 2", "Opci贸n 3", "Opci贸n 4"];
  const [currentOption, setCurrentOption] = useState(0);

  const handleOptionChange = (index) => {
    setCurrentOption(index);
  };

  return (
    <>
      <Container className="p-5">
        <Row className="justify-content-md-center" xs={1} md={1} sm={1} lg={2}>
          <Col className="d-flex flex-column justify-content-center align-items-center">
            <div className="text-center text-sm-start">
              <h1 className="title">JC</h1>
              <p className="profession">
                Soy un <span>Ingeniero de Software</span> apasionado por la programaci贸n y la creaci贸n de soluciones innovadoras es el motor que impulsa cada l铆nea que escribo.
                {/* Mantengo mi mente abierta a las nuevas tecnolog铆as, metodolog铆as y tendencias, 
                siempre listo para adoptar aquellas que puedan elevar mi trabajo al siguiente nivel. */}
              </p>
              <div className="icons my-3">
                <a href="https://github.com/JCAc10" target="_blank" rel="noopener noreferrer">
                  <i className="fa-brands fa-github fa-2x p-3"></i>
                </a>
                <a href="https://www.linkedin.com/in/jeanzamudiolab谩n" target="_blank" rel="noopener noreferrer">
                  <i className="fa-brands fa-linkedin fa-2x p-3"></i>
                </a>
                <a href="mailto:jeanzamudio29@gmail.com" target="_blank" rel="noopener noreferrer">
                  <i className="fa-brands fa-google fa-2x p-3"></i>
                </a>
              </div>
              <Button variant="outline-info" onClick={handleDownloadPDF}>Descargar CV</Button>
            </div>
          </Col>
          <Col className="d-flex justify-content-center align-items-center">
            <div className="phone-container">
              <div className="phone" style={{ backgroundColor: `rgba(0, 0, 0, ${0.1 + 0.1 * currentOption})` }}>
                <div className="screen">
                  <p className="text">
                    <div className="content">
                      <div className="content__container">
                        <p className="content__container__text">
                          {options[currentOption]}
                        </p>
                        <ul className="content__container__list">
                          {options.map((option, index) => (
                            <li
                              key={index}
                              className={`content__container__list__item ${
                                index === currentOption ? "active" : ""
                              }`}
                              onClick={() => handleOptionChange(index)}
                            >
                              {option}
                            </li>
                          ))}
                        </ul>
                      </div>
                    </div>
                  </p>
                </div>
                <div className="button-row">
                  <div className="button"></div>
                  <div className="button"></div>
                  <div className="button"></div>
                </div>
              </div>
            </div>
          </Col>
        </Row>
      </Container>
    </>
  );
};

const handleDownloadPDF = () => {
  const link = document.createElement("a");
  link.href = "../../PDF/CV-.pdf"; // Cambia esto por la ruta correcta de tu archivo PDF
  link.download = "CV-J.pdf"; // Cambia esto por el nombre que quieras para el archivo descargado
  link.target = "_blank";
  document.body.appendChild(link);
  link.click();
  document.body.removeChild(link);
};

export default Banner;
